package Java;

public class Room {
	private int id;
	private String url;
	
	public Room(int id, String url) {
		// TODO Auto-generated constructor stub
		this.id = id;
		this.url = url;
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getUrl() {
		return url;
	}

	public void setUrl(String url) {
		this.url = url;
	}

}
